            (function() {
          var fn = function() {
            Bokeh.safely(function() {
              (function(root) {
                function embed_document(root) {
                  var docs_json = {"77414256-ce7d-448f-a786-752ea5264151":{"roots":{"references":[{"attributes":{"active":0,"callback":{"id":"57b06003-5a3c-4d62-9d7a-f4b221a93cd3","type":"CustomJS"},"labels":["show Cluster","show Doublon","show Nans","show KaKs_Scores","show similarity_scores","show Length","show gc","show ecai","show cai"]},"id":"8392e513-144d-46b0-ada0-c0a6210e7370","type":"RadioButtonGroup"},{"attributes":{"args":{"source":{"id":"3daf4f25-3b8c-4f61-9c15-2f966c2356c6","type":"ColumnDataSource"}},"code":"\n            // JavaScript code goes here\n            console.log(\"callback-------callback\");\n            var colors = ['#f39c12', \"#1abc9c\", \"#3498db\", \"#2ecc71\", \"#9b59b6\", '#34495e', '#492000', '#960019',\n'#043927', '#8F9779', '#f1c40f', '#e67e22', '#e74c3c', '#7f8c8d'];\n            // the model that triggered the callback is cb_obj:\n            var b = cb_obj.get(\"active\");\n            var rgbToHex = function(rgb){\n              var hex = Number(rgb).toString(16);\n              if (hex.length < 2) {\n                   hex = \"0\" + hex;\n              }\n              return hex;\n            };\n            var fullColorHex = function(r,g,b) {\n                var red = rgbToHex(r);\n                var green = rgbToHex(g);\n                var blue = rgbToHex(b);\n                return \"#\"+red+green+blue;\n            };\n            // models passed as args are automagically available\n            var data = source.data;\n            var len = data.color.length;\n            var col = [];\n            var othercol = '#1abc9c';\n            if(b === 1){ //Doublon\n                var j = 0;\n                for(i=0;i<len;++i){\n                    if(data.doub[i]){\n                        col.push(colors[j]);\n                        col[i-1] = colors[j];\n                        j++;\n                    }else{col.push(\"#999999\");}\n                }\n                source.data.color = col;\n            }\n            if(b ===2){ //Nans\n                var temp = 0\n                max = Math.max(...data.nans)\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * (1 - ((data.nans[i] + 1) / 19)));\n                    col.push(fullColorHex(temp, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b === 0) { //Cluster\n                var j = 0;\n                if(data.clusters){\n                    for(i=0;i<len;++i){col.push(colors[1+data.clusters[i]]);}\n                }else{\n                    for(i=0;i<len;++i){col.push(othercol);}\n                }\n                source.data.color = col;\n            }\n            if(b === 3) { //KaKs_Scores\n                max = Math.max(...data.KaKs_Scores)\n                for(i=0;i<len;++i){\n                    // normalizing\n                    temp =  Math.floor(255 * (1 - (data.KaKs_Scores[i] / max)));\n                    col.push(fullColorHex(temp,temp,76))\n                }\n                source.data.color = col;\n            }\n            if(b === 4){ //similarity_scores\n                max = Math.max(...data.similarity_scores)\n                min = Math.min(...data.similarity_scores)\n                console.log(min)\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * ((data.similarity_scores[i] - min) / (max-min)));\n                    col.push(fullColorHex(temp,temp,76))\n                }\n                data.color = col;\n            }\n            if(b === 5){ //Lengths\n                max = Math.max(...data.lengths)\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * (1 - (data.lengths[i] / max)));\n                    col.push(fullColorHex(temp, temp, temp));\n                }\n                data.color = col;\n            }\n            if(b===6){ //GC\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.gc[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===7){ //ECAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.ecai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===8){ //CAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.cai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            source.change.emit();\n            "},"id":"57b06003-5a3c-4d62-9d7a-f4b221a93cd3","type":"CustomJS"},{"attributes":{"dimension":1,"plot":{"id":"8e6270e5-35ad-494a-8767-7f889a3e98d4","subtype":"Figure","type":"Plot"},"ticker":{"id":"14ee3ee6-4cc4-44d0-bd81-9353142fdf2c","type":"BasicTicker"}},"id":"31b7284e-e9d9-4409-8b9f-46d7df1c6feb","type":"Grid"},{"attributes":{"formatter":{"id":"408535c3-f02e-474c-9142-b0b7b49d5963","type":"BasicTickFormatter"},"plot":{"id":"8e6270e5-35ad-494a-8767-7f889a3e98d4","subtype":"Figure","type":"Plot"},"ticker":{"id":"389a726b-c806-4eb1-8a6c-f52d025dfa80","type":"BasicTicker"}},"id":"6a4d642b-2eac-4d22-9014-2f0a91fd43aa","type":"LinearAxis"},{"attributes":{"plot":null,"text":"Plot of the homology YPR052C"},"id":"21c35a4b-5020-4b96-9593-2a734ad7e908","type":"Title"},{"attributes":{"active_drag":"auto","active_inspect":"auto","active_scroll":"auto","active_tap":"auto","tools":[{"id":"29bf264d-292d-4029-845e-290dc3619a40","type":"HoverTool"},{"id":"d3a6f577-0e8e-4030-8fea-3d4b7b46cca9","type":"WheelZoomTool"},{"id":"1bebacf1-6e27-4586-b8f8-211cb58e3ed6","type":"PanTool"},{"id":"61bf4ee4-7229-4dc3-95c2-af7a6680358c","type":"SaveTool"},{"id":"6c9e1304-7681-4f84-8879-5f3e1
